Кандидат у депутати Львівської міської ради

Йду в депутати щоб:
- Львів розвивався за стандартами європейського міста;
- у громади міста був добробут і комфорт;
- львів’яни були фізично і духовно розвинуті;
Ставши депутатом буду дбати про:
- спорудження у Львові (вул.Сахарова) спортивно-оздоровчого комплексу з універсальною спортивною ареною європейського рівня на 6000 місць;
- забезпечення дієвого контролю за роботою комунальних служб (забезпечення теплом, водою, прибирання сміття, освітлення вулиць та інших послуг);
- встановлення справедливих тарифів на комунальні послуги;
- спрощення системи видачі дозволів на встановлення в квартирах індивідуального опалення;
- своєчасний ремонт міжквартальних доріг, тротуарів, упорядкування прибудинкових територій.
Буду підтримувати:
- розвиток благоустрою студентського містечка, заходи з покращення умов проживання в гуртожитках;
- ініціативи молоді у проведенні культурного відпочинку;
- реалізацію концепції велоруху у Львові – як перший крок влаштування велосипедних доріжок;
- проекти впорядкування зон відпочинку, відновлення дитячих та спортивних майданчиків;
- роботу громадських та неприбуткових організацій, які діють у сфері фізкультури і спорту, роботі з молоддю. 
Буду регулярно проводити прийом виборців округу для допомоги у вирішенні конкретних проблем, відстоювати інтереси виборців у міській раді.
